import { useSelector, useDispatch } from 'react-redux';
import {
  ucitajSveNastavnike,
  ucitajNastavnika,
} from '../redux/nastavnici/actions';
import styles from './Nastavnici.module.css';
import { Link } from 'react-router-dom';
import Nastavnik from './Nastavnik';

function Nastavnici() {
  const nastavnici = useSelector((state) => state.nastavnici);
  console.log(nastavnici.items.length);
  const dispatch = useDispatch();

  return (
    <div>
      {nastavnici && (
        <button
          onClick={() => {
            dispatch(ucitajSveNastavnike());
          }}
        >
          Svi nastavnici
        </button>
      )}

      {nastavnici.items.length > 1 &&
        nastavnici.items.map((nast) => {
          return (
            <div key={nast.idNastavnik} className={styles.nastavnici}>
              <Nastavnik
                id={nast.idNastavnik}
                ime={nast.ime}
                prezime={nast.prezime}
              />
              <Link
                to={'/nastavnici/' + nast.idNastavnik}
                onClick={() => {
                  dispatch(ucitajNastavnika(nast.idNastavnik));
                }}
              >
                Details
              </Link>
            </div>
          );
        })}
      {nastavnici.items.length === 1 && (
        <Nastavnik
          className={styles.nastavnici}
          ime={nastavnici.items[0].ime}
          prezime={nastavnici.items[0].prezime}
        />
      )}
    </div>
  );
}

export default Nastavnici;
